    (par-ice'-ak-tos | pa-REE-sahk-tose | pa-REE-sahk-tose)
   </em>

  <h3>
   Definition
  </h3>
  <p>
   from [G3919]; smuggled in; unawares brought in.
  </p>
  <ul>

    secretly or surreptitiously brought in
